				}, -- [3]
				{
					["r"] = false,
					["d"] = "A joint expedition of the Explorer's League and Reliquary, this fearless group of adventurers, scholars, and crafters seek to uncover the many mysteries of the Dragon Isles.",
					["w"] = false,
					["n"] = "Dragonscale Expedition",
				}, -- [4]
				{
					["r"] = false,
					["d"] = "A coalition of various races ready to defend the Emerald Dream against any and all threats.",
					["w"] = false,
					["n"] = "Dream Wardens",
				}, -- [5]
				{
					["r"] = false,
					["d"] = "The Iskaara Tuskarr have been on the Dragon Isles for generations, living in harmony and telling tales of the world around them.",
					["w"] = false,
					["n"] = "Iskaara Tuskarr",
				}, -- [6]
				{
					["r"] = false,
					["d"] = "Underneath the Dragon Isles, deep in Zaralek Cavern, lies the niffen town of Loamm. The friendly traders there are renowned for their hospitality, sense of smell, and peculiar bartering trade system.",
					["w"] = false,
					["n"] = "Loamm Niffen",
				}, -- [7]
				{
					["r"] = false,
					["d"] = "Centaur clans roam the Ohn'ahran Plains, where they follow the call of the wind and seek the thrill of the hunt.",
					["w"] = false,
					["n"] = "Maruuk Centaur",
				}, -- [8]
				{
					["r"] = true,
					["d"] = "Centered in their most ancient city, the Valdrakken Accord is the unified might of all dragonkind, seeking to protect not only their island home but all of Azeroth.",
					["w"] = false,
					["n"] = "Valdrakken Accord",
				}, -- [9]
				{
					["r"] = false,
					["d"] = "",
					["w"] = false,
					["n"] = "Artisan's Consortium - Dragon Isles Branch",
				}, -- [10]
				{
					["r"] = false,
					["d"] = "The Cobalt Assembly was once a place where blue dragons would conjure marvelous creations with arcane magic. Now it has fallen into the hands of the Sundered Flame who intend to use its magic for war.",
					["w"] = false,
					["n"] = "Cobalt Assembly",
				}, -- [11]
				{
					["r"] = false,
					["d"] = "Sabellian has established a new generation of uncorrupt black dragons, and works to protect it at all costs.",
					["w"] = false,
					["n"] = "Sabellian",
				}, -- [12]
				{
					["r"] = false,
					["d"] = "Soridormi's timewalkers travel the timeways and defend our world against limitless alternatives. When our timeline is under temporal assault or falling apart, Soridormi is the commander who holds everything together.",
					["w"] = false,
					["n"] = "Soridormi",
				}, -- [13]
				{
					["r"] = false,
					["d"] = "Long focused on protecting Azeroth, Wrathion's gaze has now turned to the future of the black dragonflight... and his destiny.",
					["w"] = false,
					["n"] = "Wrathion",
				}, -- [14]
				{
					["r"] = false,
					["d"] = "Briggul won't let Slick go with just anybody. Can you prove your worth as a snail trainer?",
					["w"] = false,
					["n"] = "Glimmerogg Racer",
				}, -- [15]
				{
					["r"] = false,
					["d"] = "The Winterpelt Furbolg speak a language no one seems to understand. Perhaps more will be revealed in the future.",
					["w"] = true,
					["n"] = "Winterpelt Furbolg",
				}, -- [16]
				{
					["r"] = false,
					["d"] = "",
					["w"] = true,
					["n"] = "Shadowlands",
				}, -- [17]
				{
					["r"] = false,
					["d"] = "After countless ages spent under the rule of Sire Denathrius, authority in Revendreth is now shared amongst the Court of Harvesters. These noble venthyr carry out the sacred duty of redeeming prideful souls.",
					["w"] = false,
					["n"] = "Court of Harvesters",
				}, -- [18]
				{
					["r"] = false,
					["d"] = "The anima drought and Drust invasion consume the Winter Queen and Wild Hunt's attention, leaving the droman of the Court of Night to protect the wildseeds and defend their groves.",
					["w"] = false,
					["n"] = "Court of Night",
				}, -- [19]
				{
					["r"] = false,
					["d"] = "The combined might of the Shadowlands covenants, brought forth to breach the Sanctum of Domination.",
					["w"] = false,
					["n"] = "Death's Advance",
				}, -- [20]
				{
					["r"] = false,
					["d"] = "The Stitchmasters are renowned for their ability to fuse flesh, bone, and anima into constructs that make them a powerful ally in Maldraxxus, and they have taken up residence in Butchers Block after seceding from the treacherous House of Constructs.",
					["w"] = false,
					["n"] = "Stitchmasters",
				}, -- [21]
				{
					["r"] = false,
					["d"] = "Korthian attendants have committed their existence to researching relics from across the Shadowlands. Led by their Archivist, they are dedicated to recovering the relics scattered across Korthia in the wake of the mawsworn invasion.",
					["w"] = false,
					["n"] = "The Archivists' Codex",
				}, -- [22]
				{
					["r"] = false,
					["d"] = "Kyrian who complete the arduous process of purging their mortal encumbrances are deemed worthy of the rite of ascension, earning their wings and pledging eternal service to the Archon.",
					["w"] = false,
					["n"] = "The Ascended",
				}, -- [23]
				{
					["r"] = false,
					["d"] = "Fiercely devoted to the Accuser, these archivists seek to restore and catalog the sinstones fragmented by the Lord Chamberlain and his Inquisitor allies.",
					["w"] = true,
					["n"] = "The Avowed",
				}, -- [24]
				{
					["r"] = false,
					["d"] = "Once members of Cartel Al, the Enlightened have abandoned the pursuit of profit and glory out of devotion to the First Ones. By earning their favor, the brokers may be willing to share the knowledge they have gleaned.",
					["w"] = false,
					["n"] = "The Enlightened",
				}, -- [25]
				{
					["r"] = false,
					["d"] = "Long ago, the Primus established the five houses of Maldraxxus to build the ultimate fighting force. Through might, cleverness, and guile, this unyielding armada is pledged to defend the Shadowlands against all threats.",
					["w"] = false,
					["n"] = "The Undying Army",
				}, -- [26]
				{
					["r"] = false,
					["d"] = "Called to serve the Winter Queen in times of dire need, the Wild Hunt assembles the finest huntresses and hunters in all of Ardenweald. In the face of drought and peril, the Wild Hunt stands ready to defend the forest.",
					["w"] = false,
					["n"] = "The Wild Hunt",
				}, -- [27]
				{
					["r"] = false,
					["d"] = "Ve'nari knows more about the Maw than anyone, and she might share a fraction of that information with you if you earn her regard.",
					["w"] = false,
					["n"] = "Ve'nari",
				}, -- [28]
				{
					["r"] = true,
					["d"] = "A new court has opened in Revendreth, where Prince Renathal attempts to unite allies from across the Shadowlands and increase his covenant's influence.",
